import PropTypes from "prop-types";
import "./FrameComponent14.css";

const FrameComponent14 = ({ className = "" }) => {
  return (
    <div className={`image-27-parent ${className}`}>
      <img
        className="image-27-icon"
        loading="lazy"
        alt=""
        src="/image-27@2x.png"
      />
      <img
        className="image-28-icon"
        loading="lazy"
        alt=""
        src="/image-28@2x.png"
      />
      <img
        className="image-29-icon"
        loading="lazy"
        alt=""
        src="/image-29@2x.png"
      />
      <img
        className="image-30-icon"
        loading="lazy"
        alt=""
        src="/image-30@2x.png"
      />
    </div>
  );
};

FrameComponent14.propTypes = {
  className: PropTypes.string,
};

export default FrameComponent14;
